def solve(coin_list, total):
    dp = [0] * (total + 1)
    dp[0] = 1
    for coin in coin_list:
        for i in range(coin, total + 1):
            dp[i] += dp[i - coin]
    return dp[total]

def solve(coins, amount):
    dp = [0] * (amount + 1)
    dp[0] = 1
    for coin in coins:
        for i in range(coin, amount + 1):
            dp[i] += dp[i - coin]
    return dp[amount]

